import React from "react";
 
const Popup = props => {
  return (
    <div className="popup-box">
        {props.type==="error" &&
            <div className="box1">
                <button className="close-icon" onClick={props.handleClose}>x</button>
                <p>Oopsi !</p>
                {props.content}
            </div>
        }
        {props.type==="register" &&
            <div className="box2">
                <button className="close-icon" onClick={props.handleClose}>x</button>
                <p className="popupTitle1">Weldone !</p>
                <p>You're registration is in good way, you should soonly receive a metamask notification !</p>
                <p>#JeSaisPasGérerLesEventAvecEthersJs</p>
            </div>
        }
        {props.type==="submit" &&
            <div className="box2">
                <button className="close-icon" onClick={props.handleClose}>x</button>
                <p className="popupTitle1">Weldone !</p>
                <p className="popupTitle2">The registration of your proposal is in good way, you should soonly receive a metamask notification !</p>
                <p>#JeSaisPasGérerLesEventAvecEthersJs</p>
            </div>
        }
        {props.type==="submit" &&
            <div className="box2">
                <button className="close-icon" onClick={props.handleClose}>x</button>
                <p className="popupTitle1">Weldone !</p>
                <p className="popupTitle2">Weldone, the registration of your proposal is in good way, you should soonly receive a metamask notification !</p>
                <p>#JeSaisPasGérerLesEventAvecEthersJs</p>
            </div>
        }
    </div>
  );
};
 
export default Popup;
